import React, {Component } from 'react';
import Animation from '../images/animation.gif';
import Static from '../images/static.png';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Button } from 'reactstrap';

class TestPage extends Component {
    // basically just bring the animation program here
    // get canvas through something like getById
    // gotta make a constructor in order to do state
    constructor(props) {
        super(props);

        this.imageRef = React.createRef();
        this.state = {
          isOpen: false
        };
      }

      toggle() {
        this.setState({
          isOpen: !this.state.isOpen
        });
      }

      changePic() {
        this.imageRef.current.src = {Static}
      }

    render() {
        const spacingContainer = {
            height: '40px'
          };
          const buttonStyle = {
            height: '75px',
            width: '225px'
          }
        return (
            <div>
                <div class="container" style={spacingContainer}></div>
                <div class="container mx-auto text-center img-thumbnail shadow-lg p-3 mb-5 bg-white rounded">
                    <img refs="imageRef" src={Animation} alt="loading..." />
                </div>
                <div class="container mx-auto text-center">
                    <button type="button" class="btn btn-outline-dark text-center btn-lg" style={buttonStyle} onClick='changePic()'>Begin Test</button>
                </div>

                <script src="animation.js"></script>
            </div>
        )
    }
}

export default TestPage;
